import '../../utils/style/header.css';
import logo from '../../assets/logo';

function Header() {
	return (<div>
			 <h1 className="kasa-title">Kasa</h1>
			 <img src={logo} alt="logo kasa" className='kasa-logo' />
	       </div>)
}

export default Header
